import React from 'react';
import TypeWriterEffect from 'react-typewriter-effect';
import Gradient from 'rgt';


const mystyle = {
  fontSize: '500px', 
  marginLeft: '600px',
  marginBottom: '700px',
  textShadow: '2px 2px',
  color: 'white'
}


const Error = () => {
  return (
  <div style={mystyle}>
    <Gradient>
    <TypeWriterEffect
            textStyle={{ fontFamily: 'Red Hat Display' }}
            startDelay={100}
            cursorColor="black"
            text="404 - Sorry Page not Found!"
            typeSpeed={100}

          />
      </Gradient>

         </div>


  );
};

export default Error;
